var b="url",c="انتشار_آگهی_استخدام_واحد_جذب_و_استخدام_.html",d="generationDate",e=new Date(1754216618188.78),f="defaultAdaptiveView",g="name",h="",i="size",j="width",k=0,l="height",m="adaptiveViews",n="sketchKeys",o="s0",p="variables",q="OnLoadVariable",r="currentTime",s="Loginv",t="page",u="packageId",v="b0bf957b12ad415f98183a1bf5841ec6",w="type",x="Axure:Page",y="انتشار آگهی استخدام(واحد جذب و استخدام)",z="notes",A="annotations",B="fn",C="1",D="ownerId",E="24ad04ad1ee24f839513e62baffcb4e2",F="label",G="(Text Field)",H="Note",I="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در صورتی که اعتبار آگهی استخدامی به پایان&nbsp; رسیده باشد، دکمه انتشار آگهی غیر فعال باشد</span></p>",J="2",K="5a19e71e48d1479e8d3e0edcf4d7091e",L="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در صورتی که آگهی دارای اعتبار باشد این برچسب با رنگ &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#50C499;\">سبز</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; نمایش داده شود</span></p>",M="3",N="b7cfc229a690411aa2c2d584089d621f",O="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در صورتی که آگهی منتشر نشده باشد این برچسب با رنگ &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#DF0F36;\">قرمز</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; نمایش داده شود</span></p>",P="4",Q="952a333a19814d078135eff67da87121",R="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در صورتی که آگهی منتشر شده باشد این برچسب با رنگ &quot;</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#BF3BBA;\">یاسی</span><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">&quot; نمایش داده شود</span></p>",S="5",T="1a125b8461044318925238a993272697",U="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در صورتی دکمه انتشار آگهی فعال باشد که آگهی استخدامی دارای اعتبار باشد</span></p>",V="6",W="4f924890785c46598a205e3c9e5ba410",X="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">با انتخاب این گزینه، آگهی استخدامی صرفا قابل مشاهده باشد(غیر قابل ویرایش)</span></p>",Y="7",Z="ecf8cf727bea43229af33b1f22efdcf9",ba="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">با انتخاب این گزینه آگهی استخدامی قابل مشاهده و ویرایش باشد</span></p>",bb="8",bc="fd708ba448d4489ea7c6281ce0f218e1",bd="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">با انتخاب این گزینه، انتشار آگهی(نمایش آگهی) در محل های منتشر شده متوقف گردد.به کاربر در خصوص توقف انتشار آگهی از طریق یک فرم مدال یک پیام هشدار نمایش داده شود </span></p>",be="9",bf="f7f6cedee6904f7fb89894904aa1dd86",bg="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">کاربر بتواند آگهی استخدامی که دارای اعتبار نمی باشد را تمدید و در صورت نیاز منتشر نماید</span></p>",bh="10",bi="e3a3a0de3e3449b683fcddd27af410a9",bj="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">تاریخ ثبت از فیلد تاریخ ثبت از فرایند &quot;ثبت آگهی استخدام&quot; واکشی و نمایش داده شود</span></p>",bk="11",bl="8891534298314f8096f4beb52f920e24",bm="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">آخرین تاریخ ویرایش واکشی و نمایش داده شود</span></p>",bn="12",bo="47e3d8be26094291aeaedf3fb1c2eb34",bp=" فیلتر",bq="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">امکان فیلتر بر اساس عنوان شغلی، شرکت یا کارخانه، تاریخ ثبت، تاریخ انتشار، تاریخ&nbsp; ویرایش ، محل انتشار، درخواست سرمایه انسانی و کد آگهی وجود داشته باشد</span></p>",br="13",bs="79f8f39b4f5d4463866313fb87e2304e",bt="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">کد آگهی ثبت شده </span></p>",bu="14",bv="bb00f57ab4ed49f68ebe6289954d4b17",bw="(10)رزومه دریافتی",bx="<p><span style=\"font-family:'2  Yekan Bold', '2  Yekan Regular', '2  Yekan', sans-serif;font-weight:700;\">با انتخاب این گزینه کاربر بتواند مشخصات و رزومه های کارجویانی که بر روی این آگهی استخدامی بر روی وب سایت&nbsp; جذب و استخدام وارد شده است را مشاهده نماید و به &quot;</span><span style=\"font-family:'2  Yekan Bold', '2  Yekan Regular', '2  Yekan', sans-serif;font-weight:700;color:#D9001B;\">فرم رزومه های دریافتی(واحد جذب و استخدام)&quot; </span><span style=\"font-family:'2  Yekan Bold', '2  Yekan Regular', '2  Yekan', sans-serif;font-weight:700;\">منتقل گردد.توجه گردد هنگامی که فرم &quot;رزومه های دریافتی&quot; باز می گردد رزومه های دریافتی بر اساس شماره آگهی فیلتر شده باشد</span></p>",by="19",bz="70faa4612b124b66b246aee37417b9d5",bA="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;color:#D9001B;\">این آگهی استخدام بدون وجود داشتن درخواست سرمایه انسانی ثبت شده است(ثبت آگهی استخدام بدون مبنا)</span></p>",bB="20",bC="04fc8bfec9f140c8b4afe7fa3faa9c08",bD="0007",bE="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">شماره درخواست(های) سرمایه انسانی که بر روی آن(ها) آگهی استخدامی ثبت گردیده است در این قسمت نمایش داده شود</span></p>",bF="21",bG="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">با کلیلک بر روی هر شماره درخواست سرمایه انسانی مشخصات کامل درخواست سرمایه انسانی در یک فرم مدال به کاربر نمایش داده شود(تمام فیلدهای فرم درخواست سرمایه انسانی غیر قابل ویرایش باشد</span></p>",bH="22",bI="3c979baa25b54c43b5369c10d458331d",bJ="23",bK="754f81e193174bab87ce16c3aabe7181",bL="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">تاریخ اعتبار از فیلد تاریخ اعتبار از فرایند &quot;ثبت آگهی استخدام&quot; واکشی و نمایش داده شود</span></p>",bM="24",bN="1d61051807ae485f897d42a65b92504d",bO="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">پس از انتشار آگهی استخدام &quot;تاریخ انتشار&quot; آگهی استخدام&nbsp; نمایش داده شود(آخرین تاریخ انتشار)</span></p>",bP="25",bQ="097faa54b7b74266b9b204ee0a678a5a",bR="و ...",bS="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در صورتی که آگهی استخدامی بر روی بیش از یک درخواست سرمایه انسانی ایجاد شده باشد با کلیک کاربر بر روی این گزینه، کاربر از طریق یک فرم مدال قادر به مشاهده درخواستهای سرمایه انسانی که بر روی آنها آگهی استخدام ایجاد گردیده است باشد و بتواند به تفکیک هر کدام از درخواستهای سرمایه انسانی را مشاهده نماید</span></p>",bT="26",bU="de47519899ed453c91d42ce83287fd74",bV="(Checkbox)",bW="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در صورت انتشار آگهی استخدام در یک یا چند محل، جهت انتشار آگهی استخدام در محل(های) دیگر در دفعات بعدی، تیک آگهی منتشر شده در محل(های) قبلی غیر قابل ویرایش باشد</span></p>",bX="27",bY="2d0050e8d4e94b4ab38e9c2c771b59bc",bZ="... و",ca="<p><span style=\"font-family:'B Yekan Bold', 'B Yekan Regular', 'B Yekan', sans-serif;font-weight:700;\">در صورتی که آگهی استخدامی بر روی عنوان شغلی برای چند شرکت ثبت شده باشد با کلیک بر روی این گزینه، کاربر از طریق یک فرم مدال قادر به مشاهده نام شرکتهایی که برای آنها بر روی عنوان شغلی آگهی استخدام ثبت گردیده است باشد</span></p>",cb="style",cc="baseStyle",cd="627587b6038d43cca051c114ac41ad32",ce="pageAlignment",cf="center",cg="fill",ch="fillType",ci="solid",cj